import React, { Component } from 'react';
import { NavLink} from 'react-router-dom';
class Reservation extends Component {
    state = {
        token: "Bearer eyJhbGciOiJIUzM4NCJ9..KsBMPpCwZLo65uB06l8-DibCCe430yuBh9WTbG1AvuE9k3x7M6jY2XmcMDRNa56F", 
        reservations: []
     }

    componentDidMount(){
    this.fetchReservations();
    }

  fetchReservations = () =>{
    fetch('http://localhost:8080/api/library/admins/reservations', {
       method: 'GET',
       headers: {"Content-Type": "application/json", "Authorization": this.state.token}
      })
    .then(res => res.json())
    .then(res => {
      this.setState({reservations: res})
    });
  }

    render() { 
        const {reservations} = this.state;
        if(!reservations.length){
            return (<div>Loading...</div>)
        }
        return ( 
            <section>

            {this.state.reservations.map((reservation, index) =>{
                return(
                <div  key={index} className="card mb-3">
                    <div className="card-body">
                        <h5 className="card-title">{reservation.title}</h5>
                        <h6 className="card-subtitle mb-2 text-muted">{reservation.id}</h6>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                        <a href="#" className="card-link">Card link</a>
                        <a href="#" className="card-link">Another link</a>
                    </div>
                </div>
                )
            })}

            </section>
         );
    }
}

export default Reservation;
